import { atom } from 'recoil';

export const navigationAtom = atom({
  key: 'navigationAtom',
  default: {
    index: 0,
    account: {},
    creditCards: [
      {
        number: 7242,
        securityCode: 252,
        expiration_date: +(new Date())
      }
    ]
  } 
});
